import React, { Component } from 'react';
import '../App.css';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <div className="container">
          <div className="row">
            <div className="col-md-12">
              <br/>
              <h2 className="display-4 text-center">Welcome</h2>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
